import './CSS/Header.css';
import masla_logo from '../Assests/masla_logo.png';
import LoginButton from "./mini/LoginButton";


export const Header = () => {
    return (
        <>
        <div className="top-bar">
            <div className="logo" >
                <img src={masla_logo} alt="mas logo" height='150px'width='150px' ></img>
            </div>
            <div>
                <LoginButton />
            </div>
        </div>
        </>
    )
}
